import logo from './logo.svg';
import './App.css';
import React from 'react'

function App() {
  const [data, setData] = React.useSate(null)

  React.useEffect(()=>{
    fetch("/api/users")
      .then( (res) => res.json )
      .then( (received) => setData(received.message))
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>{data}</h1>
      </header>
    </div>
  );
}

export default App;
